import React, { useState, useEffect } from 'react'
import { MDBContainer, MDBDataTable } from 'mdbreact'



const SubscribersMangment = () => {

  const data = {
      columns: [
          {
              label: 'שם',
              field: 'name',
              sort: 'asc',
              width: 150
          },
          {
              label: 'תאריך',
              field: 'date',
              sort: 'asc',
              width: 270
          },
          {
              label: 'קהל יעד',
              field: 'audience',
              sort: 'asc',
              width: 200
          },
          {
              label: 'מחק אירוע',
              field: 'delete',
              sort: 'asc',
              width: 100
          },
          {
              label: 'צפייה בנרשמים',
              field: 'participants',
              sort: 'asc',
              width: 150
          },
      ],

      rows: null


    }




  return (
      <MDBContainer style={{ backgroundColor: "white" }}>
              <MDBDataTable
                  entriesLabel="מספר הערכים בטבלה"
                  paginationLabel={["הקודם", "הבא"]}
                  infoLabel={["מראה", "עד", "מתוך", "ערכים"]}
                  className="text-right justify-content-center"
                  searchLabel="חיפוש"
                  btn
                  scrollY
                  maxHeight="65vh"
                  striped
                  bordered
                  small
                  data={data}
              />

      </MDBContainer>
  )
}

export default SubscribersMangment;
